import React from "react";

const MatchupCard = ({ matchup }) => {
	return (
		<div className="col">
			<div className="matchup-card">
				<p>
					{matchup.time} {matchup.date}
				</p>
				<div className="teams">
					<div className="team">
						<img></img>
						<p>{matchup.team_1.short_name}</p>
					</div>
					<div className="team">
						<img></img>
						<p>{matchup.team_2.short_name}</p>
					</div>
				</div>
			</div>
		</div>
	);
};

export default MatchupCard;
